class Pixel {}

Pixel.thumbnail = {
  width: 10,
  height: 10,
  cornerRadius: 2,
  spacing: 2
};
Pixel.full = {
  width: 64,
  height: 64,
  cornerRadius: 8,
  spacing: 4
};

export default Pixel;
